R4:=function(V)#neu
  local i,R,V2;
  V2:=List(V);Add(V2,V2[1],1);#Add(V2,V2[1],1);
  R:=[[0],[1,1]];
  for i in [3..Size(V)] do Add(R,ListWithIdenticalEntries(i,1)); od;
  Add(R,V2);
  return R;
  end;
R4([1,1]);
R4([1,1,1]);
R4([1,1,1,1]);

R5:=function(RIV)#neu
  local i,V2,RI,V;
  if IsInt(RIV[1]) then
    R:=R4(RIV);
    else
      RI:=RIV[1];V:=RIV[2];
      V2:=List(V);Add(V2,V2[1],1);#Add(V2,V2[1],1);
      R:=R5(RI);
      Add(R,V2);
      fi;
  return R;
  end;
R5([1,1]);

RINXS:=function(R,ZEIGER,S)#ohne phi ob R in XSAMMEL ist
  local PNEU,RET,i;
  RET:=0;
  PNEU:=R[S];
  i:=PZUN(PNEU,S)+1;
#  Print("XXXX",PNEU,S,Size(R));
  if IsBound(ZEIGER[i]) then
    RET:=ZEIGER[i];
#    Print(RET[1]);
    if Size(R)>S then RET:=RINXS(R,RET[6],S+1); fi;
    fi;
#  Print("****",RET);
  return RET;
  end;

