RTT:=function(S)#neu aus P04
  ri:=PL[S];
  Add(HRES,ri,1);
  PNEU:=QY11(HRES,S);
  ZR:=QY21(HRES,S,2^S,ZEIGER,PNEU);;
  HRES:=List(ZR[1]);ZR3MERK:=ZR[3];ZEIGER:=ZR[2];
  if ZR3MERK=-1 then return -10000; else
    if ZEIGER=[] or S=Size(PL) then return 1; 
      else return RTT(S+1)+1; fi;
    fi;
  end;

RAUSH:=function(HRES)
  local i,RET,S;
  S:=Size(HRES); RET:=[];
  for i in [1..S] do
    RET[i]:=UMKEHRLIST(QY11(HRES{[S-i+1..S]},i));
    od;
  return RET;
  end;

PHIAUSH:=function(HRES)
  local S;
  S:=Size(HRES); 
  return Reversed(List([1..S],i->IZUNREV(ExponentsOfPcElement(Pcgs(P),HRES[i]))));
  end;

PERMPHI:=function(PHI,S)
  local d,D,i,i0;
  D:=[];
  for d in [1..S] do
    i0:=2^(d-1);
    D[i0]:=PHI[d];
    for i in [i0+1..2^d-1] do
      D[i]:=XORMAT[D[i-i0]+1][D[i0]+1]-1;
      od;
    od;
  return PermList(D);
  end;

RNEUPHI:=function(PHI,R,S)
  local d,D,i,RNEU;
  D:=DIAG(R);
#Print(D);
  RNEU:=[];
  for d in [1..S] do
    RNEU[d]:=[D[PHI[d]+1]];
    for i in [1..d-1] do
      RNEU[d][i+1]:=D[XORMAT[PHI[i]+1][PHI[d]+1]-1+1];
      od;
    od;
  return RNEU;
  end;

