    PHI01[d]:=i0; D[i0]:=-1;INDIZES[2^(d-1)]:=i0;
#Print("\n",7,D,PHI01,INDIZES,d);
    for i in [1..2^(d-1)-1] do
      D[XORMAT[INDIZES[i]+1][PHI01[d]+1]-1]:=-1;
      INDIZES[i+2^(d-1)]:=XORMAT[INDIZES[i]+1][PHI01[d]+1]-1;
#Print("\n",8,D,PHI01,INDIZES,d,i);
      od;
